  return(
    <Container>
      <Wrapper>
          <Logo>Forni<LogoContrast>ture</LogoContrast></Logo>

          <nav>
              <ListaMenu>
                  <MenuLink to="/" >Home</MenuLink>
                  <MenuLink to="/about" >About</MenuLink>
                  <MenuLink to="/">Contact</MenuLink>

              </ListaMenu>
                  <Cart />
          </nav>
      </Wrapper>
    </Container>
  );
}

export default Header;
